import React from "react";


function StaffHeader() {
    return (
        <header className="header-staff">
            <h2 className="staff-en">STAFF</h2>
            <h3 className="staff-ja" lang="ja">スタッフ</h3>
        </header>
    );
}

export default StaffHeader;
